import { helpGod } from 'helpers';

export class AloneComponent {
  render() {
    return 'I am alone.' + helpGod();
  }
}

export class BadComponent {
  render() {
    return 'I feel bad';
  }
}

export class CoolComponent {
  render() {
    return 'Hey man, I am cool!';
  }
}

export class DecentComponent {
  render() {
    return 'What dones decent means?';
  }
}

export class EfficientComponent {
  render() {
    return 'I am effective';
  }
}

export class FunnyComponent {
  render() {
    return 'Who is the funny one?';
  }
}

export class GreatComponent {
  render() {
    return 'Mao is great!';
  }
}

